class SegmentTree
{
public:
    int n;
    vi v, tree, lazy;
    void build(int low, int high, int ind)
    {
        if (low == high)
        {
            tree[ind] = v[low];
            return;
        }
        int mid = (low + high) >> 1;

        build(low, mid, 2 * ind + 1);
        build(mid + 1, high, 2 * ind + 2);

        tree[ind] = max(tree[2 * ind + 1], tree[2 * ind + 2]);
    }
    SegmentTree(vi &v)
    {
        this->v = v;
        this->n = v.size();
        tree.resize(4 * n);
        lazy.resize(4 * n, 0);
        this->build(0, n - 1, 0);
    }
    void update(int ind, int low, int high, int l, int r, int val)
    {
        if(lazy[ind])
        {
            tree[ind] += lazy[ind];
            if(low != high)
            {
                lazy[2 * ind + 1] += lazy[ind];
                lazy[2 * ind + 2] += lazy[ind]; 
            }
            lazy[ind] = 0;
        }

        int mid = (low + high) >> 1;
        if(low >= l && high <= r)
        {
            tree[ind] += val;
            if(low != high)
            {
                lazy[2 * ind + 1] += val;
                lazy[2 * ind + 2] += val;
            }
            return;
        }

        if(high < l || low > r)
        {
            return;
        }

        update(2 * ind + 1, low, mid, l, r, val);
        update(2 * ind + 2, mid + 1, high, l, r, val);

        tree[ind] = max(tree[2 * ind + 1], tree[2 * ind + 2]);
    }
    int query(int low, int high, int l, int r, int ind)
    {
        if (lazy[ind])
        {
            tree[ind] += lazy[ind];
            if (low != high)
            {
                lazy[2 * ind + 1] += lazy[ind];
                lazy[2 * ind + 2] += lazy[ind];
            }
            lazy[ind] = 0;
        }
        int mid = (low + high) >> 1;
        if (low > r || high < l)
        {
            return LLONG_MIN;
        }
        if (low >= l && high <= r)
        {
            return tree[ind];
        }
        int left = query(low, mid, l, r, 2 * ind + 1);
        int right = query(mid + 1, high, l, r, 2 * ind + 2);

        return max(left , right);
    }
    int query(int l, int r)
    {
        return query(0, n - 1, l, r, 0);
    }
    void update(int l, int r, int val)
    {
        update(0, 0, n - 1, l, r, val);
    }
};

vi Tree[N], flat;

int dp[N], depth[N], heavy[N], start[N], idx[N];
int parent[N] = {1};

int dfs(int par, int node)
{
    dp[node] = 1;
    int max_child_size = 0;
    for(auto i : Tree[node])
    {
        if(i != par)
        {
            parent[i] = node;
            depth[i] = 1 + depth[node];
            int child_size = dfs(node, i);
            if(child_size > max_child_size)
            {
                max_child_size = child_size;
                heavy[node] = i;
            }
            dp[node] += child_size;
        }
    }
    return dp[node];
}

int timer = 0;
vi tin(N), tout(N);
void decompose(int par, int node, int head)
{
    tin[node] = timer++;
    start[node] = head;
    if(heavy[node] != 0)
    {
        decompose(node, heavy[node], head);
    }

    for(auto i : Tree[node])
    {
        if((i != par) && (i != heavy[node]))
        {
            decompose(node, i, i);
        }
    }
    tout[node] = timer++;
}


void solve()
{
    int n;
    cin >> n;

    vi value;

    f(i, 0, n - 1)
    {
        int s, d;
        cin >> s >> d;
        Tree[s].pb(d);
        Tree[d].pb(s);
    }
    
    dfs(-1, 1);
    decompose(-1, 1, 1);

    value.resize(timer + 5, 0LL);
    SegmentTree st(value);

    int q;
    cin >> q;

    while(q--)
    {
        string s;
        cin >> s;

        if(s == "add")
        {
            int node, val;
            cin >> node >> val;

            st.update(tin[node], tout[node], val);
        }
        else 
        {
            int a, b;
            cin >> a >> b;
            int ans = LLONG_MIN;

            while(start[a] != start[b])
            {
                if(depth[start[a]] < depth[start[b]])
                {
                    swap(a, b);
                }

                ans = max(ans, st.query(tin[start[a]], tin[a]));
                a = parent[start[a]];
            }
            if(depth[a] < depth[b]) swap(a, b);

            ans = max(ans, st.query(tin[b], tin[a]));
            cout << ans << endl;
        }
    }
}

signed main()
{
    fast();
    int t = 1;
    // cin >> t;
    while (t--)
    {
        solve();
    }
    return 0;
}

