    }

    public Double getValor() {
        return valor;
    }

    public void setValor(Double valor) {
        this.valor = valor;
    }
    
     public double calcularGanhosPoupanca() {

        
         // F√≥rmula: F = P * (1 + i)^n + M * [(1 + i)^n - 1] / i

        double parte1 = 0 * Math.pow((1 + this.getJuros()), this.getAnos());
        double parte2 = this.getValor() * ((Math.pow((1 + this.getJuros()), this.getAnos()) - 1) / this.getJuros());

        return parte1 + parte2;
    }

}

